<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title>Rider Heatmaps</title>
    <style>
      /* Always set the map height explicitly to define the size of the div
       * element that contains the map. */
      #map {
        height: 100%;
      }
      /* Optional: Makes the sample page fill the window. */
      html, body {
        height: 100%;
        margin: 0;
        padding: 0;
      }
      #floating-panel {
        position: absolute;
        top: 10px;
        left: 25%;
        z-index: 5;
        background-color: #fff;
        padding: 5px;
        border: 1px solid #999;
        text-align: center;
        font-family: 'Roboto','sans-serif';
        line-height: 30px;
        padding-left: 10px;
      }
      #floating-panel {
        background-color: #fff;
        border: 1px solid #999;
        left: 25%;
        padding: 5px;
        position: absolute;
        top: 10px;
        z-index: 5;
      }
    </style>
  </head>

  <body>
    <div id="floating-panel">
      <button onclick="toggleHeatmap()">Toggle Heatmap</button>
      <button onclick="changeGradient()">Change gradient</button>
      <button onclick="changeRadius()">Change radius</button>
      <button onclick="changeOpacity()">Change opacity</button>
        <br />
        <!--int? NumberofRecords = null, double? LastDateFrom = null, double? LastDateTo = null, double? LastTimeFrom=null, double? LastTimeTo=null, string phone=null)-->
        <input type="text" id="NumberofRecords" title="NumberofRecords" placeholder="NumberofRecords" value="1000" />
        <input type="date" id="LastDateFrom" placeholder="LastDateFrom" title="LastDateFrom" />
        <input type="date" id="LastDateTo" placeholder="LastDateTo" title="LastDateTo"/>
        <input type="time" id="LastTimeFrom" placeholder="LastTimeFrom"  title="LastTimeFrom"/>
        <input type="time" id="LastTimeTo"  placeholder="LastTimeTo"title="LastTimeTo"/>
        <input type="text" id="phone" placeholder="phone" title="phone" />
        <input type="button" onclick="setHeatMap()" />
    </div>
